<!-- Modal -->
<ng-template #modal let-modal>
  <div class="modal-header p-2">
    <h3 class="modal-title">Village Details</h3>
    <button
      type="button"
      class="close text-danger p-2"
      aria-label="Close"
      (click)="modal.dismiss('Cross click')"
    >
      <span aria-hidden="true">&times;</span>
    </button>
  </div>
  <div class="modal-body p-5">
    <div *ngIf="villageData">
      <p><strong>Village Name:</strong> {{ villageData.villagename }}</p>
      <p>
        <strong>Voting Percentage:</strong> {{ villageData.votingpercentage }} %
      </p>
      <p><strong>Reason:</strong> {{ villageData.reason }}</p>
    </div>
  </div>
</ng-template>
